'use client'
import { memo, useEffect, useRef, useState } from 'react'
import Image from 'next/image'
import Link from 'next/link'
import { Toast } from 'primereact/toast'
import classNames from 'classnames'
import { gsap } from 'gsap'
import CivilImage from '@/assets/images/civil.png'
import DinnerImage from '@/assets/images/dinner.png'


const MAX_TIME_VALUE = 10
const CVU = '0000003100090356031917'


const HomePage = () => {
  const toast = useRef<Toast>(null)
  const [ isFirstCharge, setIsFirstCharge ] = useState<boolean>(true)
  const [ isFlip, setIsFlip ] = useState<boolean>(false)
  const [ disabled, setDisabled ] = useState<boolean>(false)

  useEffect(() => setIsFirstCharge(false), [])

  useEffect(() => {
    if(!isFirstCharge) {
      setDisabled(true)
      if(isFlip) {
        const timeline = gsap.timeline()

        timeline.to('.HomePage__Card-Content', {
          duration: 0.1,
          scale: 0.95,
          boxShadow: '0 0 0 rgba(0, 0, 0, 0)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.3,
          scale: 1.05,
          boxShadow: '0 0 45px rgba(0, 0, 0, 0.65)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.6,
          rotateY: 180,
          boxShadow: '0 0 45px rgba(0, 0, 0, 0.65)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.3,
          scale: 1,
          boxShadow: '0 0 0 rgba(0, 0, 0, 0)',
        })

        timeline.play()
        timeline.eventCallback('onComplete', () => setDisabled(false))
      } else {
        const timeline = gsap.timeline()

        timeline.to('.HomePage__Card-Content', {
          duration: 0.1,
          scale: 0.95,
          boxShadow: '0 0 0 rgba(0, 0, 0, 0)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.3,
          scale: 1.05,
          boxShadow: '0 0 45px rgba(0, 0, 0, 0.65)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.6,
          rotateY: 0,
          boxShadow: '0 0 45px rgba(0, 0, 0, 0.65)',
        })
        timeline.to('.HomePage__Card-Content', {
          duration: 0.3,
          scale: 1,
          boxShadow: '0 0 0 rgba(0, 0, 0, 0)',
        })

        timeline.play()
        timeline.eventCallback('onComplete', () => setDisabled(false))
      }
    }
  }, [ isFlip ])


  const handleCopyOnCliboard = () => {
    navigator.clipboard.writeText(CVU)
    // Show toast

    if(toast?.current) {
      toast.current?.show({
        severity: 'info',
        summary: 'CVU copiado',
      })
    }
  }


  return (
    <main className="HomePage">
      <div className="HomePage__Card">
        <div
          className={classNames(
            'HomePage__Card-Content',
          )}
        >
          <div className="HomePage__Card-Front">
            <div className="w-full h-full flex flex-col justify-between items-center">
              <Letters/>
              <Calendar/>
            </div>
            <div className="HomePage__Divisor"></div>
            <div className="w-full h-full flex flex-col justify-around items-center">
              <Title/>
              <Schedule/>
            </div>
          </div>

          <div className="HomePage__Card-Back">
            <BackTextOne/>

            <div className="flex flex-col items-center gap-2">
              <BackTextTwo/>

              <div className="flex items-center gap-2">
                <div className="w-[36px] h-[36px]"></div>
                <span className="text-white text-[18px]">{ CVU }</span>
                <button
                  className='HomePage__Copy'
                  onClick={handleCopyOnCliboard}
                >
                  <i className='pi pi-copy'/>
                </button>
              </div>
            </div>

            <div className="flex flex-col items-center gap-2">
              <BackTextThree/>
              <Link
                className='HomePage__Button'
                href='https://drive.google.com/drive/folders/1B1JzubUXvrvij9k2s9umwKOymm6vqKEN?usp=sharing'
                target='_blank'
              >
                <i className='pi pi-images'/>
              </Link>
            </div>
          </div>
        </div>
      </div>

      <button
        className='HomePage__Flip-Button'
        onClick={() => setIsFlip(!isFlip)}
        disabled={disabled}
      >
        <i
          className={classNames(
            'pi pi-replay HomePage__Icon',
            { 'HomePage__Icon-Rotate': isFlip },
          )}
        ></i>
      </button>

      <Toast
        ref={toast}
        position='bottom-center'
      />
    </main>
  )
}

